    """Convert SymPy's expression to ``dtype``. """
    try:
        return self([self.dom.from_sympy(a)])
    except CoercionFailed:
        pass

    from sympy.polys.numberfields import to_number_field

    try:
        return self(to_number_field(a, self.ext).native_coeffs())
