def _not_a_coeff(expr):
    """Do not treat NaN and infinities as valid polynomial coefficients. """
    if type(expr) in illegal_types or expr in finf:
        return True
    if isinstance(expr, float) and float(expr) != expr:
        return True  # nan
    return  # could be

sympy.sympy.polys.puiseux.__repr__:
def __repr__(self) -> str:
    def format_power(base: str, exp: MPQ) -> str:
        if exp == 1:
            return base
        elif exp >= 0 and int(exp) == exp:
            return f"{base}**{exp}"
        else:
            return f"{base}**({exp})"

    ring = self.ring
    dom = ring.domain

    syms = [str(s) for s in ring.symbols]
    terms_str = []
    for monom, coeff in sorted(self.terms()):
        monom_str = "*".join(format_power(s, e) for s, e in zip(syms, monom) if e)
        if coeff == dom.one:
            if monom_str:
                terms_str.append(monom_str)
            else:
                terms_str.append("1")
        elif not monom_str:
            terms_str.append(str(coeff))
        else:
            terms_str.append(f"{coeff}*{monom_str}")

    return " + ".join(terms_str)

